import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Login from './pages/Login';
import BugReport from './pages/BugReport';

function App() {
  return (
    <Router>
      <nav className="bg-blue-700 text-white p-4 flex gap-4">
        <h1 className="text-4xl font-bold text-center">Bem-vindo ao BugHunter üêû</h1>
        <p className="text-center text-gray-600 mt-2">Sistema simples de relato de bugs com React + Flask</p>

        <Link to="/">Login</Link>
        <Link to="/report">Relatar Bug</Link>
      </nav>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/report" element={<BugReport />} />
      </Routes>
    </Router>
  );
}

export default App;
